"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[477],{10:function(t){t.exports=JSON.parse('{"blogPosts":[{"id":"/2022/05/14/a-page-with-tools","metadata":{"permalink":"/blog/2022/05/14/a-page-with-tools","editUrl":"https://github.com/curseforgecommunity/curseforgecommunity.github.io/tree/main/blog/2022-05-14-a-page-with-tools.md","source":"@site/blog/2022-05-14-a-page-with-tools.md","title":"A page with all collected community tools for CurseForge?!","description":"Wait.. what? A new page, that contains all tools? Nah, that\'s can\'t be right.","date":"2022-05-14T00:00:00.000Z","formattedDate":"May 14, 2022","tags":[{"label":"curseforge","permalink":"/blog/tags/curseforge"},{"label":"tools","permalink":"/blog/tags/tools"},{"label":"community","permalink":"/blog/tags/community"}],"readingTime":0.985,"truncated":true,"authors":[{"name":"NoLifeKing85","title":"Community Support","url":"https://nolifeking85.tv","imageURL":"https://github.com/itssimple.png","key":"nolifeking"}],"frontMatter":{"title":"A page with all collected community tools for CurseForge?!","authors":["nolifeking"],"tags":["curseforge","tools","community"]}},"content":"Wait.. what? A new page, that contains all tools? Nah, that\'s can\'t be right.\\n\\n\x3c!--truncate--\x3e\\n\\nWell, not entirely, since we\'re only just starting up with collecting all the tools.\\n\\nAnd we\'re starting with the tools that we\'ve built ourselves to start with.\\n\\n# New tools\\n\\nThese are some of the tools we\'ve built ourselves.\\n\\n## CF-MC-Server\\n\\nThis one packs a punch. It\'s a CLI (Command Line Interface) that allows you to install a Minecraft server, with the extra feature, that you can download modpacks from CurseForge with it, and use as servers.\\n\\nMade by: [NoLifeKing85](https://nolifeking85.tv)\\n\\n## What CurseForge project is this? / CFLookup\\n\\nThis project aims to provide a way to look up CurseForge projects by their ID, and get the project\'s data, which is used to get the project\'s page.\\n\\nAnd we also get really cool embeds, that you can use in your Discord server, Twitter, Facebook, LinkedIn, etc.\\n\\nMade by: [NoLifeKing85](https://nolifeking85.tv)\\n\\n## CurseForge API Client (.NET, NuGet)\\n\\nThis project aims to be a fully functional .NET client that allows you to use the CurseForge API,\\n\\nAll you need is an API key, your partner ID and a contact email to get started.\\n\\nMade by: [NoLifeKing85](https://nolifeking85.tv)"}]}')}}]);